drop table zipcode;

create table zipcode (
`zipcode` char(6) not null,
`groupNo` char(3) not null,
`sido` varchar(5) not null,
`gugun` varchar(10) not null,
`dong` varchar(100) not null,
`ri` varchar(100) not null,
`island` varchar(100) not null,
`bunji` varchar(100) not null,
`bunji1` varchar(100) not null,
`bunji2` varchar(100) not null,
`bunji3` varchar(100) not null,
`note` varchar(100) not null,
`dong1` varchar(100) not null,
`dong2` varchar(100) not null,
INDEX (zipcode)) ENGINE=InnoDB DEFAULT CHARACTER SET=utf8;

